import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import ResumePage from './pages/ResumePage';
import ResumePreviewPage from './pages/ResumePreviewPage';
import CompanyExplorer from './components/CompanyExplorer';
import RoadmapPage from './pages/RoadmapPage';
import InterviewPage from './pages/InterviewPage';

function App() {
  return (
    <Router>
      <div className="min-h-screen flex flex-col bg-white text-gray-800 font-inter">
        {/* Navbar */}
        <header className="bg-blue-700 text-white sticky top-0 shadow-md z-50">
          <div className="max-w-7xl mx-auto px-4 py-4 flex justify-between items-center">
            <h1 className="text-lg md:text-xl font-bold">CareerLaunch</h1>
            <nav className="space-x-4 text-sm md:text-base">
              <Link to="/" className="hover:text-yellow-300">üè† Home</Link>
              <Link to="/resume" className="hover:text-yellow-300">üìù Resume</Link>
              <Link to="/roadmap" className="hover:text-yellow-300">üìö Roadmap</Link>
              <Link to="/interview" className="hover:text-yellow-300">üíº Interview</Link>
              <Link to="/companies" className="hover:text-yellow-300">üè¢ Companies</Link>
            </nav>
          </div>
        </header>

        {/* Page Content */}
        <main className="flex-grow max-w-7xl mx-auto p-4 md:p-8">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/resume" element={<ResumePage />} />
            <Route path="/resume/preview" element={<ResumePreviewPage />} />
            <Route path="/roadmap" element={<RoadmapPage />} />
            <Route path="/interview" element={<InterviewPage />} />
            <Route path="/companies" element={<CompanyExplorer />} />
          </Routes>
        </main>

        {/* Footer */}
        <footer className="bg-gray-100 py-4 text-center text-sm text-gray-500">
          ¬© 2025 CareerLaunch. All rights reserved.
        </footer>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <div className="text-center mt-20 text-xl font-semibold">
      üöÄ Welcome to <span className="text-blue-600">CareerLaunch</span> ‚Äì Your Ultimate Placement Prep Guide!
    </div>
  );
}

export default App;
